function generate_file_random_de($string, $length=5)
{
	$charset = file_get_contents(base_url("be3System/char.be3"));
	//$encode = file_get_contents(base_url("be3System/fai.php"));
	//echo $string;
	$char = explode('| ', $charset);
	$char[] = '|';
	$char[] = ' ';

	$myFile = base_url("be3System/fai.php?i=" . time());
	$lines = file($myFile); //file in to an array

	//$string = $text;
	$split_text = str_split(explode('H', $string)[1], $length);
	$split_en   = str_split($lines[array_search(explode('H', $string)[0], explode('H', $lines[0]))], 5);
	$alphabetic = $char;
	$decrypt    = "";
	//print_r($split_en);

	//print_r($de);
	for ($x = 0; $x < count($split_text); $x++) {
		$de = $alphabetic[array_search($split_text[$x], $split_en)];
		if (isset($de)) {
			//echo ''.$split_text[$x].'<br>';
			if ($split_text[$x] == "8dasg") {
				$decrypt .= " ";
			} else if ($split_text[$x] == "\n") {
				$decrypt .= " ";
			} else {

				$decrypt .= trim($de);
			}
		} else {
			$decrypt .= $split_text[$x];
		}
	}
	$decrypt = str_replace("carlin", "\r", $decrypt);
	$decrypt = str_replace("newlin", "\n", $decrypt);
	$decrypt = str_replace("extab", "\t", $decrypt);
	$decrypt = str_replace("alert ", "\a", $decrypt);
	//echo $decrypt;
	return nl2br($decrypt);
}
function generate_file_random_en($text, $static = false, $length=5)
{
	$charset = file_get_contents(base_url("be3System/char.be3"));
	$encode = file_get_contents(base_url("be3System/fai.be3"));
	$char = explode('| ', $charset);
	$char[] = '|';
	$char[] = ' ';
	//echo ''.count($charset);
	//echo '<br>'.count(str_split($encode,5));
	$myFile = base_url("be3System/fai.be3");
	$lines = file($myFile); //file in to an array

	//echo $lines[0]; //line 2
	if ($static == true) {

		is_numeric(str_split($text)[0]) ?
		$number_en   = str_split($text)[0] :
		$number_en   = array_search(strtolower(str_split($text)[0]), str_split('abcdefghijklmnopqrstuvwxyz1234567890'));;
		//echo strlen('abcdefghijklmnopqrstuvwxyz1234567890');;
		//if()
		//echo count(explode('H',$lines[0]));
		$split_en   = str_split($lines[$number_en], $length);
		//clean_all_processes();
		//$ent = explode('Faa',$c)[$l + 1];
	} else {
		$number_en = rand(1, 50);
		$split_en   = str_split($lines[$number_en], $length);
	} //$text =  "Hilfi Muhamad Aryawan %20";

	$text = preg_replace("/\r/", "carlin", $text);
	$text = preg_replace("/\n/", "newlin", $text);
	$text = preg_replace("/\t/", "extab", $text);
	$text = preg_replace("/\a/", "alert", $text);
	//echo '<pre>'.$text.'</pre>';
	$split_text = str_split($text);

	//$split_date = str_split(date('Y-m-d'));
	$alphabetic = $char;

	for ($i = 0; $i < count($alphabetic) - 1; $i++) {

		$en[trim($alphabetic[$i])] = $split_en[$i];
	}
	$en[' '] = $split_en[$i];
	$en[chr(13)] = $split_en[$i + 1];
	//print_r($en);
	$encrypt = "";
	for ($x = 0; $x < count($split_text); $x++) {

		//echo $split_text[$x].':'.$en[$split_text[$x]].'<br>';
		if (isset($en[$split_text[$x]]))
			$encrypt .= $en[$split_text[$x]];
	}

	$r = explode('H', $lines[0])[$number_en] . 'H' . $encrypt;
	//echo ''.$r;
	return $r;
	//echo $encrypt;
}

